import React from 'react'
import {useCart} from 'react-use-cart';

const Cart = () => {
    const {isEmpty,totalUniqueItems,items} = useCart();
    if(isEmpty) return <p></p>
    return (
        <>
        <p>this is cart</p>
          <p>{totalUniqueItems}</p>  
        </>
    )
}

export default Cart;
